import { Typography, Button, TableContainer, Paper, Table, TableHead, TableRow, TableCell, TableBody, Box } from "@mui/material";
import { Edit, Delete } from "@mui/icons-material";
import { useAppDispatch} from "../../App/Store/ConfigureStore";
import {  removeProduct, setPageNumber } from "../Catalog/CatalogSlice";
import { useState } from "react";
import useProducts from "../../App/hooks/useProducts";
import AppPagination from "../../App/Components/AppPagination";
import ProductForm from "./productForm";
import { Product } from "../../App/Models/Product";
import Agent from "../../App/Api/Agent";
import { LoadingButton } from "@mui/lab";


export default function Inventory() {

    const {products, pageData} =  useProducts();
    const dispatch = useAppDispatch();
    const [editMode, setEditMode] = useState(false);
    const [selectedProduct, setSelectedProduct] = useState<Product | undefined>(undefined);
    const[loading, setLoading] = useState(false);
    const[target,setTarget] = useState(0);

    function handleSelectedProduct(product:Product){
        setSelectedProduct(product);
        setEditMode(true);
    }

    function handleDeleteProduct(id:number) {
        setLoading(true);
        setTarget(id);
        Agent.Admin.deleteProduct(id)
            .then(() => dispatch(removeProduct(id)))
            .catch(err => console.log(err))
            .finally(() => setLoading(false));
    }

    function cancelEdit(){
        if(selectedProduct) setSelectedProduct(undefined);
        setEditMode(false);
    }

    if(editMode) return <ProductForm product={selectedProduct} cancelEdit={cancelEdit}/>
    
    return (
        <>
            <Box display='flex' justifyContent='space-between'>
                <Typography sx={{ p: 2 }} variant='h4'>Inventory</Typography>
                <Button onClick={() => setEditMode(true)} sx={{ m: 2 }} size='large' variant='contained'>Create</Button>
            </Box>
            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell align="left">ProductId</TableCell>
                            <TableCell align="right">Price</TableCell>
                            <TableCell align="center">Gender</TableCell>
                            <TableCell align="center">Size</TableCell>
                            <TableCell align="center">Description</TableCell>
                            <TableCell align="center">Quantity In Stock</TableCell>
                            <TableCell align="right"></TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {products.map((product) => (
                            <TableRow
                                key={product.id}
                                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                            >
                                <TableCell component="th" scope="row">
                                    {product.id}
                                </TableCell>
                                <TableCell align="left">
                                    <Box display='flex' alignItems='center'>
                                        <img src={product.pictureUrl} 
                                        alt={product.name} style={{ height: 50, marginRight: 20 }} />
                                        <span>{product.name}</span>
                                    </Box>
                                </TableCell>
                                <TableCell align="right">{product.price}</TableCell>
                                <TableCell align="center">{product.gender}</TableCell>
                                <TableCell align="center">{product.size}</TableCell>
                                <TableCell align="center">{product.description}</TableCell>
                                <TableCell align="center">{product.quantityInStock}</TableCell>
                                <TableCell align="right">
                                    <Button onClick={() => handleSelectedProduct(product)} startIcon={<Edit />} />
                                    <LoadingButton loading={loading && target === product.id} 
                                    startIcon={<Delete />} color='error' />
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
            {pageData &&
                <Box sx={{pt:2}}>
                    <AppPagination 
                    pageData={pageData} 
                    onPageChange={(page:number) => 
                    dispatch(setPageNumber({pageNumber:page}))}/>
                </Box>
            }
        </>
    )
}
